import { useState } from "react";

export const Display = () => {
  const [value, setValue] = useState("");
  const changeValue = (value) => {
    setValue(value);
  };
  return (
    <div class="border-2 p-2 m-3 rounded-3xl h-[126px] flex justify-end items-end">
      <input
        class="h-full w-full rounded-3xl text-3xl text-end p-2"
        onChange={(e) => setValue(e.target.value)}
        value={value}
      ></input>
    </div>
  );
};

export default Display;
